    <style>
      [ng\:cloak], [ng-cloak], [data-ng-cloak], [x-ng-cloak], .ng-cloak, .x-ng-cloak, .ng-hide:not(.ng-hide-animate) {
        display: none !important;
      }

      ng\:form {
        display: block;
      }

      * {
        box-sizing: border-box;
      }

      #splash-screen {
        display: none;
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        background-color: #3C4252;
        z-index: 99999;
      }

      [ng-cloak]#splash-screen {
        display: block !important;
      }

      #splash-screen .logo {
        width: 200px;
        height: 100px;
        line-height: 100px;
        margin: 0 auto 48px auto;
        font-family: Helvetica Neue, Helvetica, Arial, sans-serif;
        font-size: 56px;
        text-align: center;
        /*border-radius: 2px;*/
        /*background-color: #039BE5;*/
        color: #FFFFFF;
        /*box-shadow: 0 2px 14px 0 rgba(0, 0, 0, 0.22);*/
      }
      #splash-screen .logo img {
        width: 124px;
        height: 26px;
      }

      .spinner-center {
        display: block;
        width: 100%;
        position: absolute;
        top: 50%;
        transform: translateY(-50%);
      }

      .spinner-wrapper {
        position: relative;
        margin: 0 auto;
        text-align: center;
        -webkit-transform: translate3d(0, 0, 0);
        -ms-transform: translate3d(0, 0, 0);
        transform: translate3d(0, 0, 0);
      }

      .spinner-wrapper .outer-spinner {
        display: inline-block;
        width: 48px;
        height: 48px;
        -webkit-animation: rotate 2.25s linear infinite;
        animation: rotate 2.25s linear infinite;
      }

      .spinner-wrapper .outer-spinner .spinner {
        display: inline-block;
        position: relative;
        width: 48px;
        height: 48px;
        -webkit-animation: sporadic-rotate 5s ease infinite;
        animation: sporadic-rotate 5s ease infinite;
      }

      .spinner-wrapper .outer-spinner .spinner .left {
        position: absolute;
        overflow: hidden;
        top: 0;
        left: 0;
        width: 24px;
        height: 48px;
      }

      .spinner-wrapper .outer-spinner .spinner .left .circle {
        width: 48px;
        height: 48px;
        border: 4px solid #4285F4;
        border-right-color: transparent;
